function qValue = update(Q, state, state2, reward, action, action2, alpha, gamma)    predict = Q(state, action);  target = reward + gamma*Q(state2, action2);  #Q(state, action) = Q(state, action) + alpha * (target - predict);      Q(state, action) = (1-alpha)*predict + alpha*(target);  qValue =  Q(state, action);  end